import React from "react";
import { EduProgramProvider } from "./context/EduProgramContext";
import EduProgram from "./pages/EduProgram/EduProgram";
import "./styles/index.css";

function App() {
  return (
    <EduProgramProvider>
      <div className="app-container">
        <h1 className="app-title">Edu Program App</h1>
        <EduProgram />
      </div>
    </EduProgramProvider>
  );
}

export default App;
